import React from 'react';
import './css/UI.css'

function List(){
  var title ="Morning Activity";
  var desc ="Take a jogg and drink coffee.";
  return(
    <div class="card-body list">
    {title}<br></br>
    {desc}
    </div>
  );
}
export default List;
